import { Box } from "@mui/material";

const Login = () => {
  return (
    <Box
      display="flex"
      justifyContent="center"
      sx={{ width: "100%", boxSizing: "border-box" }}
    >
      <Box
        display="flex"
        width="700px"
        height="700px"
        sx={{ border: "1px solid" }}
      >
        <Box sx={{ border: "1px solid" }}>1</Box>
        <Box sx={{ border: "1px solid" }}>1</Box>
        <Box sx={{ border: "1px solid" }}>1</Box>
        <Box sx={{ border: "1px solid" }}>1</Box>
        <Box sx={{ border: "1px solid" }}>1</Box>
      </Box>
    </Box>
  );
};

export default Login;
